import React from "react";
import { useNavigate, useLocation } from "react-router-dom";
import "./TemplateSelection.css";

const templates = [
  {
    id: "modern",
    name: "Modern Template",
    description: "A clean and contemporary design with a focus on readability",
    preview: (
      <svg width="100%" height="100%" viewBox="0 0 300 400" xmlns="http://www.w3.org/2000/svg">
        <rect width="100%" height="100%" fill="#f8f9fa"/>
        <rect width="60%" height="8" x="20%" y="50" fill="#e9ecef"/>
        <circle cx="150" cy="100" r="30" fill="#dee2e6"/>
        <rect width="80%" height="6" x="10%" y="160" fill="#e9ecef"/>
        <rect width="80%" height="6" x="10%" y="180" fill="#e9ecef"/>
        <rect width="40%" height="6" x="10%" y="220" fill="#dee2e6"/>
        <rect width="80%" height="4" x="10%" y="240" fill="#e9ecef"/>
        <rect width="80%" height="4" x="10%" y="255" fill="#e9ecef"/>
        <rect width="80%" height="4" x="10%" y="270" fill="#e9ecef"/>
        <rect width="40%" height="6" x="10%" y="300" fill="#dee2e6"/>
        <rect width="80%" height="4" x="10%" y="320" fill="#e9ecef"/>
        <rect width="80%" height="4" x="10%" y="335" fill="#e9ecef"/>
        <rect width="80%" height="4" x="10%" y="350" fill="#e9ecef"/>
      </svg>
    )
  },
  {
    id: "professional",
    name: "Professional Template",
    description: "Traditional layout perfect for corporate positions",
    preview: (
      <svg width="100%" height="100%" viewBox="0 0 300 400" xmlns="http://www.w3.org/2000/svg">
        <rect width="100%" height="100%" fill="#f8f9fa"/>
        <rect width="90%" height="40" x="5%" y="20" fill="#e9ecef"/>
        <rect width="25%" height="280" x="5%" y="80" fill="#dee2e6"/>
        <rect width="60%" height="6" x="35%" y="80" fill="#e9ecef"/>
        <rect width="60%" height="6" x="35%" y="100" fill="#e9ecef"/>
        <rect width="60%" height="6" x="35%" y="140" fill="#dee2e6"/>
        <rect width="60%" height="4" x="35%" y="160" fill="#e9ecef"/>
        <rect width="60%" height="4" x="35%" y="175" fill="#e9ecef"/>
        <rect width="60%" height="6" x="35%" y="215" fill="#dee2e6"/>
        <rect width="60%" height="4" x="35%" y="235" fill="#e9ecef"/>
        <rect width="60%" height="4" x="35%" y="250" fill="#e9ecef"/>
      </svg>
    )
  },
  {
    id: "creative",
    name: "Creative Template",
    description: "Stand out with a unique design for creative roles",
    preview: (
      <svg width="100%" height="100%" viewBox="0 0 300 400" xmlns="http://www.w3.org/2000/svg">
        <rect width="100%" height="100%" fill="#f8f9fa"/>
        <circle cx="150" cy="80" r="40" fill="#dee2e6"/>
        <rect width="70%" height="8" x="15%" y="140" fill="#e9ecef"/>
        <rect width="40%" height="8" x="30%" y="160" fill="#dee2e6"/>
        <rect width="90%" height="60" x="5%" y="190" fill="#e9ecef" rx="4"/>
        <rect width="90%" height="40" x="5%" y="260" fill="#dee2e6" rx="4"/>
        <rect width="90%" height="40" x="5%" y="310" fill="#e9ecef" rx="4"/>
      </svg>
    )
  }
];

const TemplateSelection = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const resumeData = location.state?.resumeData;

  const handleTemplateSelect = (templateId) => {
    if (!resumeData) {
      navigate("/");
      return;
    }

    navigate("/resume-preview", {
      state: {
        resumeData,
        templateId,
      },
    });
  };

  if (!resumeData) {
    return (
      <div className="template-selection-container">
        <h2>Please complete your resume information first</h2>
        <button onClick={() => navigate("/")}>Go Back</button>
      </div>
    );
  }

  return (
    <div className="template-selection-container">
      <h2>Select Your Resume Template</h2>
      <div className="templates-grid">
        {templates.map((template) => (
          <div
            key={template.id}
            className="template-card"
            onClick={() => handleTemplateSelect(template.id)}
          >
            <div className="template-preview">
              {template.preview}
            </div>
            <h3>{template.name}</h3>
            <p>{template.description}</p>
            <button className="select-button">Select Template</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TemplateSelection;
